function App() {
  let [currentpage, setCurrentpage] = useState("")
let openplaylist = (e) => {
  setCurrentpage(e.target.className)

}
  return (
    <div>
      <header>
      <ul>
        <li><img src={logo} style={{"height":"50px","width":"50px"}}/></li>
        <li>HOME</li>
        <li>ABOUT US</li>
        <li>PRICING</li>
      </ul>
     {
      currentpage !== ""?<Playlistpage shoplaylist={currentpage}/>:<Homepage selected={openplaylist}/>
    }

      </header>
    </div>
  );
}

export default App;
